import ReactDOM from 'react-dom'
import App from './App.js'

const names = [
  {
    id: 1,
    name: "Diana Oguren",
    number: 8912,
  },
  {
    id: 2,
    name: "Eric Silver",
    number: 8912,
  },
  {
    id: 3,
    name: "Sara Herron",
  }
]

ReactDOM.render(
  <App name={names} />,
  document.getElementById('root')
)
